  if(action.name==="TEST_TOGGLE"){
    return {test:!state.test}
  }
}


class App extends Component {
  actio= ()=>{
    return {
      name:"TEST_TOGGLE"
    }
  }
  render() {
    return(
        <h1>store.dispatch(action)</h1>
    )
  }
}

export default App;
